import { useCookies } from "react-cookie";
import { useNavigate } from "react-router-dom";
import { useEffect, useState } from "react";
import axios from "axios";

function Home() {
    const [cookies, setCookie] = useCookies();
    const [name, setName] = useState("");
    const navigate = useNavigate();
    const [people, setPerson] = useState([]);

    useEffect(() => {
        if (cookies.username === undefined) {
            navigate('/');
        }
        axios.get('http://localhost:4000/authenticate', { headers: { "Authorization": `Bearer ${cookies.username}` } }).then(response => {
            console.log(people);
        }).catch(err => {
            console.log(err);
            navigate("/");
        })
    }, [cookies.username]);

    useEffect(() => {
        if (name.length > 0) {
            axios.post('http://localhost:4000/getartists', {
                name: name
            }).then(response => {
                setPerson([]);
                setPerson(response['data']);
                console.log(people);
            }).catch(err => {
                console.log(err);
            })
        }
    }, [name]);

    return <div>
        <input placeholder="Type Name" onChange={(e) => { setName(e.target.value) }}></input>
        <div class="card" style="width: 18rem;">
            <img class="card-img-top"alt="Card image cap"/>
                <div class="card-body">
                    <h5 className="card-title">Card title</h5>
                    <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                    <a href="#" class="btn btn-primary">Go somewhere</a>
                </div>
        </div>
    </div>
}

export default Home;
